import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { moveiService } from '../services/movieService'

const BASE_URL_IMG = 'https://image.tmdb.org/t/p/original'


export function MoveiList({ fetch }) {
    const [movies, setMovies] = useState([])
    useEffect(() => {
        const movies = getMovies()
    }, [])
    async function getMovies() {
        // const movies = await axios.get(fetch)
        const req = await axios.get(`https://api.themoviedb.org/3${fetch}`)
        const movies = req.data.results
        console.log('movies is:', movies);
        setMovies(movies)
        return movies
    }
    return (
        <div className="row-movie">
            {movies.map(movie => {
                return <div key={movie.id}><img src={`${BASE_URL_IMG}${movie.poster_path}`} alt="" /></div>
            })}
        </div>
    )
}
